import Page from "./Common_page/Page";
import login_img from "../../../img/login.jpg";
const Home = () => {
  return (
    <>
      <div className="bg">
        <div className="clild_div">
          <div className="row">
            <div className="col-6">
              <img src={login_img} alt="" />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
